            ).Country
        )
    );
    ClearCollect(
        getdataforseq,
        Ungroup(
            ForAll(
                Sequence(CountRows(getdatafor)),
                {
                    myrec: Table(
                        Last(
                            FirstN(
                                getdatafor,
                                Value
                            )
                        )
                    ),
                    Rowno: Value
                }
            ),
            "myrec"
        )
    )
    ,
    "OMS",
    ClearCollect(
        MASTOUTB,
        AddColumns(
            Filter(
                'Master Out Bound',
                Company = ComboboxCanvas1_54.Selected.Title,
                Date >= DatePicker1_40.SelectedDate && Date <= DatePicker1_41.SelectedDate,
                'Fulfillment Type'.Value = "Order"
